import React from 'react';

import CustomExpandedBox from '../customExpandedBox';
/**
 * @file module:src/components/ExtendedLine/index.jsx  
 * @param {*} props
 * @param {number} props.index -   
 * @returns 
 */

export default function ExtendedTableRow(props){  
    

    console.log("THIS USER DATA",props.thisUserData);

    let accessData = [props.thisUserData.currentAccess.user_access_business_technoloy,props.thisUserData.currentAccess.user_access_business_technoloy ]; 
    let addressData = props.thisUserData.currentAddress; 
    let jobData = props.thisUserData.currentJob; 
    let productData = props.thisUserData.productsBuyed; 

    console.log("ACCESS DATA",accessData);
    console.log("ADDRESS DATA",addressData);
    console.log("JOB DATA",jobData);
    console.log("PRODUCT DATA",productData);



    return (   
        <div style={style.container}>
            <CustomExpandedBox
            boxWidth="20%"
            bgColor= "#ffb5bc"
            boxTitle= "Acesso do Usuário"
            boxHeight = "cacl(100% / 4)"
            fieldsList = {[{label: "Rede",fieldKey: "currentAccess"}]}
            fieldValues = {{accessData}}

            />
               
            <CustomExpandedBox
            boxWidth="20%"
            bgColor= "#ffb5bc"
            boxTitle= "Endereço do Usuário"
            boxHeight = "cacl(100% / 4)"
            fieldsList = {[{label: "Endereco",fieldKey: "currentAddress"}]}
            fieldValues = {{addressData}}
            userId = {props.id}
            userIndex = {props.index}



            /> 
 
            <CustomExpandedBox
            boxWidth="20%"
            bgColor= "#ffb5bc"
            boxTitle= "Emprego do Usuário"
            boxHeight = "cacl(100% / 4)"
            fieldsList = {[{label: "Emprego",fieldKey: "currentJob"}]}
            fieldValues = {{jobData}}
            userId = {props.id}

            /> 
 
            <CustomExpandedBox
            boxWidth="20%"
            bgColor= "#ffb5bc"
            boxTitle= "Produto comprado"
            boxHeight = "cacl(100% / 4)"
            fieldsList = {[{label: "Produto",fieldKey: "productsBuyed"}]}
            fieldValues = {{productData}}
            userId = {props.id}

            /> 
            
        </div>
    )
}


const style = {
    container: {
        width: "100%",
        height: "100%",
        flexDirection: "row",
        alignContent: "center"
    }
    

};
